import React from 'react';
import styled from 'styled-components';

const ContainerParent = styled.div`
  background-color: white;
`;

const ContainerStyled = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  padding: 100px;
  background-color: white;
`;

const LeftContent = styled.div`
  flex: 0.35;
  width: 30%;
  height: 100%;
`;

const ImageBox = styled.img`
  flex: 1;
  border-radius: 50px;
  width: 300px;
  height: 300px;
`

const RightContent = styled.div`
  flex: 1;
  text-align: left;
  width: 100%;
  flex-direction: column;
`;

const Introduction_Title = styled.p`
  font-size: 32px;
`;

const Introduction = styled.p`
  font-size: 16px;
`;
const Home = () => {
    return (
        <ContainerParent>
            <ContainerStyled>
                <LeftContent>
                    <ImageBox src="/profile.jpeg"/>
                </LeftContent>
                <RightContent>
                    <Introduction_Title>
                        Developer Subin
                    </Introduction_Title>
                    <Introduction>
                        안녕하세요, 저는 클라이언트 개발자이며, 그래픽과 웹 프론트엔드에 큰 관심을 가지고 있는 사람입니다.<br/>
                        웹 디자인과 사용자 경험을 개선하는 데 열정을 가지고 있습니다.
                    </Introduction>
                    <ImageBox src="/profile.jpeg"/>
                </RightContent>
            </ContainerStyled>
        </ContainerParent>

    )
};

export default Home;
